"""Several statistics for MPs."""

# known errors:
# add statistics[stat]['target'] from statistics_counts.py - affects only amendments

import pandas as pd
import requests_html

# term
term = 8

data_path = "data/"

# get the list of MPs
mps = pd.read_csv(data_path + "mps.csv")

# load attendance
attendance = pd.read_csv(data_path + "attendance.v1.all.csv")

# merge attendance to mps
mps = pd.merge(mps, attendance.loc[:, ['mp_id', 'name', 'photo_url', 'attendance', 'possible']], on='mp_id', how='left')

max_possible = mps['possible'].max()

# create a session
session = requests_html.HTMLSession()


# test
mp_id = 858 # Kuffa
mp_id = 808 # Matovič
mp_id = 997 # Blcháč

# statistics
statistics = {
  # ho = hodina otázok = question hour
  # 'ho': 'https://www.nrsr.sk/web/Default.aspx?sid=schodze/ho_result&AssignerId={}&CisObdobia={}', 
  # interpellations
  # 'interpellations': 'https://www.nrsr.sk/web/Default.aspx?sid=schodze/interpelacie_result&ZadavatelId={}&CisObdobia={}',
  # 'amendments': 'https://www.nrsr.sk/web/Default.aspx?sid=schodze/nrepdn&PoslanecMasterID={}&CisObdobia={}',
  # legislative initiative = návrhy zákonov
  # 'legislative_initiative': 'https://www.nrsr.sk/web/Default.aspx?sid=zakony/sslp&PredkladatelID=0&PredkladatelPoslanecId={}&CisObdobia={}'
  # amendments = pozmeňujúce návrhy,
  'speeches': 'https://www.nrsr.sk/web/Default.aspx?sid=schodze/rozprava/vyhladavanie&CPT=&CisSchodze=0&PoslanecID={}&DatumOd=1900-1-1%200:0:0&DatumDo=2100-1-1%200:0:0&TypVystupenia=&CisObdobia={}'
}

for stat in statistics:
  mps[stat] = 0

# for all statistics:
for stat in statistics:
  # for all MPs
  for mp_id in mps['mp_id']:
    url = statistics[stat]
    print(url.format(mp_id, term))
    r = session.get(url.format(mp_id, term))
    hidden_inputs = r.html.find("input[type='hidden']")
    form_values = {input_elem.attrs['name']: input_elem.attrs.get('value', '') for input_elem in hidden_inputs}
    ho = 0

    # test for existence of questions
    if r.html.text.find("ie sú evidované") > 0:
      last_page = 0
    else:
      # ho += len(r.html.find(".tab_zoznam", first=True).find("[target='_self']"))
      ho += len(r.html.find(".tab_zoznam", first=True).find(".tab_zoznam_nonalt"))
      ho += len(r.html.find(".tab_zoznam", first=True).find(".tab_zoznam_alt"))
      ho += len(r.html.find(".tab_zoznam", first=True).find(".tab_zoznam_nalt"))
      try:
        lpl = r.html.find(".pager", first=True).find("tr", first=True).text.split("\n")
        last_sign = lpl[len(lpl) - 1]
        # if it is more than 10, it displays '»'
        # we download last page and get the number of pages
        if last_sign == '»':
          datax = form_values.copy()
          datax['__EVENTARGUMENT'] = "Page$Last"
          datax['__EVENTTARGET'] = "_sectionLayoutContainer$ctl01$_resultGrid"
          r1 = session.post(url.format(mp_id, term), data=datax)
          lpl1 = r1.html.find(".pager", first=True).find("tr", first=True).text.split("\n")
          last_page = int(lpl1[len(lpl1) - 1])
        else:
          last_page = int(lpl[len(lpl) - 1])
      except: 
        last_page = 1

    # get number of questions
    for i in range(2, last_page + 1):
      print(url.format(mp_id, term), "page=" + str(i))
      datax = form_values.copy()
      datax['__EVENTARGUMENT'] = "Page$" + str(i)
      datax['__EVENTTARGET'] = "_sectionLayoutContainer$ctl01$_ResultGrid"
      r = session.post(url.format(mp_id, term), data=datax)
      try:
        ho += len(r.html.find(".tab_zoznam", first=True).find(".tab_zoznam_nonalt"))
        ho += len(r.html.find(".tab_zoznam", first=True).find(".tab_zoznam_alt"))
        ho += len(r.html.find(".tab_zoznam", first=True).find(".tab_zoznam_nalt"))
      except:
        ho += 0
      hidden_inputs = r.html.find("input[type='hidden']")
      form_values = {input_elem.attrs['name']: input_elem.attrs.get('value', '') for input_elem in hidden_inputs}

    # insert ho into mps
    mps.loc[mps['mp_id'] == mp_id, stat] = ho

mps.to_csv(data_path + "mps.stat.test2.csv", index=False)


